import styled from "styled-components";

export const ModalStyle = styled.div`

    .modal {
        margin-top: -20px;
        margin-left: 31%;
        width: 50vw;
        height: 40vh;
        border: solid 5px black;
        background: #555;
        position: fixed;
        border-radius: 10px;
        display: flex;
        flex-direction: column;
    }

    & svg {
        margin-left: 100px;
        margin-top: 5px;
        align-self: end;
    }

    .content {
        widht: 100vw;
        height: 80vh;
        display: flex;
        flex-direction: column;
        justify-content: space-between;
        margin: 0px;
        background: red;
    }

`
